import React, { useState } from 'react';

function Payments() {
    const [showAccountDetails, setShowAccountDetails] = useState(false);
    const [showPinEntry, setShowPinEntry] = useState(false);
    const [bsb, setBsb] = useState('');
    const [accountNumber, setAccountNumber] = useState('');

    const isContinueEnabled = bsb.replace(/\s+/g, '').length === 6 && accountNumber.replace(/\s+/g, '').length === 9;

    const formatNumberWithSpaces = (value) => {
        return value.replace(/\D/g, '') // 移除所有非数字字符
            .replace(/(\d{3})(?=\d)/g, '$1 '); // 每三位数字后面加一个空格
    };

    const handleBsbChange = (e) => {
        const formattedValue = formatNumberWithSpaces(e.target.value);
        setBsb(formattedValue);
    };

    const handleAccountNumberChange = (e) => {
        const formattedValue = formatNumberWithSpaces(e.target.value);
        setAccountNumber(formattedValue);
    };

    const styles = {
        container: {
            backgroundColor: '#f4f4f4',
            minHeight: '100vh',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            width: '100%',
            boxSizing: 'border-box',
            padding: 0,
            overflowX: 'hidden',
        },
        header: {
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
            width: '100%',
            marginBottom: '20px',
            boxSizing: 'border-box',
            padding: '10px',
        },
        headerText: {
            fontSize: '24px',
            fontWeight: 'bold',
        },
        quickActionsContainer: {
            display: 'flex',
            justifyContent: 'space-around',
            width: '60%',
            marginBottom: '20px',
        },
        quickActionButton: {
            backgroundColor: '#007bff',
            color: '#fff',
            padding: '15px 30px',
            borderRadius: '25px',
            textAlign: 'center',
            fontSize: '18px',
            cursor: 'pointer',
            flex: 1,
            margin: '0 10px',
        },
        quickPayContainer: {
            width: '90%',
            marginBottom: '20px',
        },
        quickPayHeader: {
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
            marginBottom: '10px',
        },
        quickPayHeader1: {
            fontSize: '25px',
            fontWeight: 'bold',
        },
        quickPayHeader2: {
            fontSize: '19px',
            color: '#007bff',
            cursor: 'pointer',
        },
        quickPayItems: {
            display: 'flex',
            justifyContent: 'space-around',
            alignItems: 'center',
        },
        quickPayItem: {
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            cursor: 'pointer',
        },
        quickPayIcon: {
            width: '60px',
            height: '60px',
            borderRadius: '50%',
            backgroundColor: '#ADD8E6',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            color: '#0066CC',
            fontSize: '24px',
            marginBottom: '5px',
        },
        scheduledContainer: {
            width: '90%',
            backgroundColor: '#fff',
            borderRadius: '10px',
            padding: '15px',
            boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
            marginBottom: '20px',
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
        },
        failedContainer: {
            width: '90%',
            backgroundColor: '#fff',
            borderRadius: '10px',
            padding: '15px',
            boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
            marginBottom: '20px',
            borderLeft: '5px solid red',
        },
        transactionList: {
            width: '90%',
            backgroundColor: '#fff',
            borderRadius: '10px',
            padding: '15px',
            boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
            marginBottom: '20px',
            boxSizing: 'border-box',
            margin: '0 20px',
        },
        transactionItem: {
            display: 'flex',
            justifyContent: 'space-between',
            marginBottom: '10px',
        },
        footer: {
            display: 'flex',
            justifyContent: 'space-around',
            width: '100%',
            backgroundColor: '#fff',
            padding: '10px 0',
            boxShadow: '0 -2px 8px rgba(0, 0, 0, 0.1)',
            marginTop: 'auto',
            boxSizing: 'border-box',
        },
        footerItem: {
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            fontSize: '12px',
        },
        footerIcon: {
            fontSize: '24px',
            color: '#007bff',
            marginBottom: '5px',
        },
        accountDetailsContainer: {
            position: 'fixed',
            bottom: showAccountDetails ? '0' : '-100%',
            left: 0,
            width: '100%',
            height: '80%',
            backgroundColor: '#fff',
            borderTopLeftRadius: '20px',
            borderTopRightRadius: '20px',
            boxShadow: '0 -2px 8px rgba(0, 0, 0, 0.1)',
            transition: 'bottom 0.3s ease',
            padding: '20px',
            zIndex: 1000,
        },
        accountDetailsHeader: {
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
            marginBottom: '20px',
        },
        backButton: {
            fontSize: '24px',
            color: '#007bff',
            cursor: 'pointer',
            flexShrink: 0,
        },
        accountDetailsTitle: {
            fontSize: '20px',
            fontWeight: 'bold',
            textAlign: 'center',
            flex: 1,
        },
        formGroup: {
            marginBottom: '15px',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'flex-start',
        },
        formLabel: {
            marginBottom: '5px',
            fontSize: '16px',
            fontWeight: 'bold',
        },
        formInput: {
            width: 'calc(100% - 40px)', // 确保输入框不会超出页面
            padding: '10px',
            fontSize: '16px',
            borderRadius: '5px',
            border: '1px solid #ccc',
            boxSizing: 'border-box',
        },
        formNote: {
            fontSize: '12px',
            color: '#999',
            marginTop: '5px',
        },
        continueButton: {
            width: '30%',
            padding: '15px',
            borderRadius: '25px',
            backgroundColor: isContinueEnabled ? '#007bff' : '#e0e0e0',
            textAlign: 'center',
            fontSize: '18px',
            color: isContinueEnabled ? '#fff' : '#999',
            cursor: isContinueEnabled ? 'pointer' : 'not-allowed',
            marginTop: '20px',
            marginLeft: 'auto',
            marginRight: 'auto', // 使按钮水平居中
            display: 'block', // 确保按钮为块级元素
            onClick: isContinueEnabled ? () => {
                setShowPinEntry(true);
                setShowAccountDetails(false);
            } : null,
        },
        pinEntryContainer: {
            backgroundColor: '#f4f4f4',
            minHeight: '100vh',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            borderRadius: '20px 20px 0 0', // 顶部左右角圆角
            padding: '20px',
        },
        pinEntryHeader: {
            fontSize: '24px',
            fontWeight: 'bold',
            marginBottom: '20px',
        },
        pinDots: {
            display: 'flex',
            justifyContent: 'center',
            marginBottom: '30px',
        },
        dot: {
            width: '10px',
            height: '10px',
            borderRadius: '50%',
            backgroundColor: '#000',
            margin: '0 5px',
        },
        keypad: {
            display: 'grid',
            gridTemplateColumns: 'repeat(3, 1fr)',
            gap: '10px',
        },
        keypadButton: {
            width: '70px',
            height: '70px',
            borderRadius: '50%',
            backgroundColor: '#e0e0e0',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            fontSize: '24px',
            cursor: 'pointer',
        },
        pinEntryFooter: {
            marginTop: '20px',
            display: 'flex',
            justifyContent: 'space-between',
            width: '100%',
            padding: '0 20px',
        },
        pinEntryFooterLink: {
            fontSize: '16px',
            color: '#007bff',
            cursor: 'pointer',
        },
    };

    const PinEntry = () => (
        <div style={styles.pinEntryContainer}>
            <div style={styles.pinEntryHeader}>Enter Your Access PIN</div>
            <div style={styles.pinDots}>
                <div style={styles.dot}></div>
                <div style={styles.dot}></div>
                <div style={styles.dot}></div>
                <div style={styles.dot}></div>
                <div style={styles.dot}></div>
                <div style={styles.dot}></div>
            </div>
            <div style={styles.keypad}>
                {['1', '2', '3', '4', '5', '6', '7', '8', '9', '0'].map((num) => (
                    <div key={num} style={styles.keypadButton}>{num}</div>
                ))}
            </div>
            <div style={styles.pinEntryFooter}>
                <div style={styles.pinEntryFooterLink}>Forgot PIN</div>
                <div style={styles.pinEntryFooterLink}>Cancel</div>
            </div>
        </div>
    );

    return (
        <div style={styles.container}>
            <div style={styles.header}>
                <div>👤</div>
                <div style={styles.headerText}>Payments</div>
                <div>🔍</div>
            </div>

            <div style={styles.quickActionsContainer}>
                <div style={styles.quickActionButton} onClick={() => setShowAccountDetails(true)}>💲 Pay</div>
                <div style={styles.quickActionButton}>🔄 Transfer</div>
            </div>

            {showPinEntry ? (
                <PinEntry />
            ) : (
                <div style={styles.accountDetailsContainer}>
                    <div style={styles.accountDetailsHeader}>
                        <div style={styles.backButton} onClick={() => setShowAccountDetails(false)}>←</div>
                        <div style={styles.accountDetailsTitle}>Account Details</div>
                    </div>

                    <div style={styles.formGroup}>
                        <div style={styles.formLabel}>BSB</div>
                        <input type="text" style={styles.formInput} value={bsb} onChange={handleBsbChange} />
                    </div>
                    <div style={styles.formGroup}>
                        <div style={styles.formLabel}>Account Number</div>
                        <input type="text" style={styles.formInput} value={accountNumber} onChange={handleAccountNumberChange} />
                    </div>
                    <div style={styles.formGroup}>
                        <div style={styles.formLabel}>Account Name</div>
                        <input type="text" style={styles.formInput} />
                        <div style={styles.formNote}>Account name won't be matched, verified or checked with the BSB and account number.</div>
                    </div>

                    <div style={styles.continueButton}>Continue</div>
                </div>
            )}
        </div>
    );
}

export default Payments;
